int size(){
    int i;
    for(i=0;A[i]!=-1;i++);
    return(i);
}

void bad_bsort(){
    int i,j,N,temp;
    N=size();
    for(i=0;i<N;i++){
        for(j=i+1;j<N;j++){
            if(A[i]<A[j]){
                temp=A[i];
                A[i]=A[j];
                A[j]=temp;
            }
        }
    }
}
void bsort(){
    int i,j,N,temp;
    int issorted=1;
    N=size();
    for(i=0;i<N;i++){
        for(j=i+1;j<N;j++){
            if(A[i]<A[j]){
                temp=A[i];
                A[i]=A[j];
                A[j]=temp;
                issorted=0;
            }
        }
        if(issorted==1)
        return;
    }
}
void selsort(){
    int i,j,m,temp;
    int N=size();
    for(i=0;i<N;i++){
        m=i;
        for(j=i+1;j<N;j++){
            if(A[m]>A[j])
            m=j;
        }
        if(m!=i){
            temp=A[i];
            A[i]=A[m];
            A[m]=temp;
        }
    }
}
void FAILEDinsort(){
    int j,k,temp;
    int SIZE=size();
    for(j=1;j<SIZE;j++){
        for(k=j-1;k>-1;k--){
            if(A[j]<A[k])
                continue;
            else
                break;
        }
    }
    temp=A[j];
    A[j]=A[k];
    A[k]=temp;
}
void insort(){//insertion sort
    int j,k,temp;
    int SIZE=size();//{4,2,7,1,3,-1}
    for(j=1;j<SIZE;j++){
        temp = A[j];
        for(k=j-1;k>=0;k--){
            if(A[k]>temp)
                A[k+1] = A[k];
            else
                break;
        }
        A[k+1] = temp;
    }
}
int partition_old(int left, int right) {//for quick sort;
    int pivot = A[right];
    int i = left - 1;
    int temp;

    for (int j = left; j < right; j++) {
        if (A[j] <= pivot) {
            i++;
            temp = A[i];
            A[i] = A[j];
            A[j] = temp;
        }
    }

    temp=A[i + 1];
    A[i + 1]=A[right];
    A[right]=temp;

    return(i + 1);
}

void quicksortold(int left,int right){
    if(left>=right)
        return;
    int piv;
    piv=partition_old(left,right);
    quicksortold(left,piv-1);
    quicksortold(piv,right);
}


